__NUXT_JSONP__("/blog/poetry/conclusion-and-elation", {data:[{post:{title:"Conclusion and Elation",content:{html:"\u003Cp\u003EEnchanting sapphire eyes\u003Cbr\u003EAnd comely freckled face\u003Cbr\u003EI find it no surprise\u003Cbr\u003EMy heart should stand in place\u003C\u002Fp\u003E\u003Cp\u003EI never thought it wise\u003Cbr\u003EFor love to come apace\u003Cbr\u003EYet, some feelings arise\u003Cbr\u003ENo wisdom can efface\u003C\u002Fp\u003E\u003Cp\u003EThat zeal the mind belies\u003Cbr\u003EThe heart cannot debase\u003Cbr\u003EIn time it time it will abscise\u003Cbr\u003EFalse wisdom and show grace\u003C\u002Fp\u003E\u003Cp\u003EWhat joy to be unwise\u003Cbr\u003EAnd love, therefore, embrace\u003Cbr\u003EWhat hope to lose the lies\u003Cbr\u003EAnd find you in their place\u003C\u002Fp\u003E"},slug:"conclusion-and-elation",date:"2019-01-28",createdAt:"2021-02-03T02:10:10.515474+00:00",updatedAt:"2021-06-30T19:58:07.687574+00:00",featuredImage:{url:"https:\u002F\u002Fmedia.graphcms.com\u002FtH8VROgUSoSiC5oOA0VO"}}}],fetch:{},mutations:void 0});